		            break;
		        case "mouseout":
		            //e.currentTarget.gotoAndPlay("out");

		                    this.currentPage = "Play";
		                    this.currentInitialPage = 0;
		                    this.currentResultInitialPage = 0;
		                    this.gotoAndPlay("transition");
		                    break;
		                case "btn_yes":
		                    this.obj_prompts.gotoAndPlay("out");
		                    if (this.promptAction == "Menu") {
		                        this.currentPage = "Menu";
		                        this.restartCards();
		                        this.gotoAndPlay("results");
		                    } else if (this.promptAction == "Restart") {
		                        this.restartCards();
		                    } else if (this.promptAction == "Submit") {
		                        this.currentPage = "Results";
		                        this.gotoAndPlay("results");
		                    }
		                    break;
		                case "btn_no":
		                    this.currentPage = "Play";
		                    this.obj_prompts.gotoAndPlay("out");
		                    this.playTimer();
		                    break;
		                case "btn_continue":
		                    this.obj_prompts.gotoAndPlay("out");
		                    this.currentPage = "Results";
		                    this.gotoAndPlay("results");
		                    break;
		                case "btn_Home":
		                    if(this.currentPage == "Play"){
		                        this.callPrompt("Menu");
		                    }else if (this.currentPage == "Results"){
		                        this.currentPage = "Menu";
		                        this.gotoAndPlay("exit");
		                    }else{
		                        this.currentPage = "Menu";
		                        this.gotoAndPlay("transition");
		                    }
		                    this.currentInitialPage = 0;
		                    break;
		                case "btn_submit":
		                    this.callPrompt("Submit");
		                    break;
		                case "btn_restart":
		                    this.callPrompt("Restart");
		                    break;
		                case "btn_how":
		                    this.bgMusic.play();
		                    this.obj_pages.obj_menu.gotoAndPlay("mainOut");
		                    break;
		                case "btn_leaderBoard":
		                    this.bgMusic.play();
		                    this.obj_pages.obj_menu.gotoAndPlay("leaderBoard");
		                    break;
		                case "btn_dismiss":
		                    this.obj_Oprompt.gotoAndPlay("out");
		                    break;
		                case "btn_play":
		                    this.currentPage = "Round" + this.roundNum;
		                    this.txt_stageRound.txt_gRound.text = "Level " + this.roundNum;
		                    this.gotoAndPlay("transition");
		                    this.bgMusic.play();
		                    this.currentInitialPage = 0;
		                    whichLevel.call(this, this);
		                    break;
		                case "btn_next":
		                    e.currentTarget.gotoAndPlay("out");
		                    console.log(this.currentInitialPage + " " + this.currentRoundPage);
		                    if(this.currentInitialPage != this.totalPage[this.roundNum-1]){
		                        this.currentInitialPage++;
		                    }
		                    this.currentRoundPage.gotoAndPlay("in" + this.currentInitialPage);
		                    break;
		                case "btn_back":
		                    this.currentRoundPage.gotoAndPlay("out" + this.currentInitialPage);
		                    e.currentTarget.gotoAndPlay("out");
		                    if(this.currentInitialPage != 0){
		                        this.currentInitialPage--;
		                    }
		                    break;
		                case "btn_rNext":
		                    console.log("btn_rNext");
		                    if(this.currentResultInitialPage != this.totalRPage[this.roundNum-1]){
		                        this.currentResultInitialPage++;
		                    }
		                    this.obj_results.gotoAndStop(this.currentResultInitialPage);

		                    this.currentPage = "Round" + this.roundNum;

		var isDragging = false, draggedCard = null, offset = {x:0,y:0}, dragOrigin = null;

		function getGridPosition(index) {
			console.log("getGridPosition this.panelSettings " + this.panelSettings);

		function parsePointsAndCost(cardType) {
		    var match = cardType.match(/^([obp])_p(\d+)_c(\d+)$/i);
		    if (!match) return { color: null, points: 0, cost: 0 };
		    var colorMap = { o: "orange", b: "blue", p: "purple" };
		    var color = colorMap[match[1].toLowerCase()] || match[1];
		    return {
		        color: color,
		        points: Number(match[2]),
		        cost: Number(match[3])
		    };
		}
		//remove children from panel and cards array (panel object, cards object array)
		this.panelAndCardsArr_refresh = function(panel, cardsObjArr) {
		    if(cardsObjArr.length){
		        for (var i = cardsObjArr.length - 1; i >= 0; i--) {
		            var ccard = cardsObjArr[i];
		            if (panel.contains(ccard)) panel.removeChild(ccard);
		            cardsObjArr.splice(i, 1);
		        }
		    }
		}
		this.startCardSetup = function(cardsArr, panel, cardsObjArr, scrollOffset, draggable) {
		    this.panelAndCardsArr_refresh(panel, cardsObjArr);
		    // SET FLAG: Indicate we are processing the Project Panel
		    this._isLayingOutProjectPanel = (panel === this.projectPanels[this.roundNum - 1]);
		    for (var i = 0; i < cardsArr.length; i++) {
		        var CardClass = lib[cardsArr[i]];
		        if (!CardClass) continue;
		        var card = new CardClass();
		        card.cardWidth = cardWidth;
		        card.cardHeight = cardHeight;
		        card.cursor = (draggable) ? "pointer" : "default";
		        card._originPanel = this.projectPanel;
		        card._originIndex = i;
		        card._cardType = cardsArr[i];
				console.log("caller 1");
		        var pos = getGridPosition.call(this, i); 
		        card.x = pos.x;
		        card.y = pos.y;
		        panel.addChild(card); 
		        cardsObjArr.push(card);
		        if (draggable) makeDraggable(card, this);
		    }
		    addScrollbarToPanel.call(this, panel, cardsObjArr, scrollOffset, visibleRows);
		    // UNSET FLAG
		    this._isLayingOutProjectPanel = false;
		}
		function makeDraggable(card, timeline) {
		    card.on("mousedown", function(evt) {
		        isDragging = true;
		        draggedCard = card;
		        dragOrigin = {
		            panel: card._originPanel,
		            index: timeline.cards.indexOf(card) >= 0 ? timeline.cards.indexOf(card) : timeline.selectedCards.indexOf(card)
		        };
		        var global = card.parent.localToGlobal(card.x, card.y);
		        stage.addChild(card);
		        card.x = (evt.stageX / stage.scaleX) - cardWidth/2;
		        card.y = (evt.stageY / stage.scaleY) - cardHeight/2;
		        offset.x = cardWidth/2;
		        offset.y = cardHeight/2;
		        stage.on("stagemousemove", dragHandler);
		        stage.on("stagemouseup", dropHandler.bind(timeline));
		    });
		}
		function dragHandler(evt) {
		    if (!isDragging || !draggedCard) return;
		    draggedCard.x = (evt.stageX / stage.scaleX) - offset.x;
		    draggedCard.y = (evt.stageY / stage.scaleY) - offset.y;
		    //stage.update();
		}
		function panelHit(card, panel) {
		    if (!panel || typeof panel.localToGlobal !== "function") return false;
		    var g = panel.localToGlobal(0,0);
		    var centerX = card.x + cardWidth/2;
		    var centerY = card.y + cardHeight/2;
		    // Note: panelWidth is a global variable (1240). This might cause issues 
		    // for smaller selected panels in L2 if their actual width isn't 1240.
		    // For now, we keep the original logic.
		    return ( 
		        centerX >= g.x && centerX <= g.x + panelWidth &&
		        centerY >= g.y && centerY <= g.y + panelHeight
		    );
		}
		// === REFACTORED DROP HANDLER ===
		// === REFACTORED DROP HANDLER ===
		function dropHandler(evt) {
		    if (!isDragging || !draggedCard) return;
		    var card = draggedCard;
		    isDragging = false;
		    draggedCard = null;
		    var roundIdx = this.roundNum - 1;
		    var dropPanels = this.selectedPanels[roundIdx];
		    // Remove from project panel array
		    var idx = this.cards.indexOf(card);
		    if (idx >= 0) this.cards.splice(idx, 1);
		    // Remove from selectedCards arrays
		    if (Array.isArray(this.selectedCards[roundIdx][0])) {
		        // Multi-panel
		        this.selectedCards[roundIdx].forEach(function(panelArr){
		            var idx = panelArr.indexOf(card);
		            if (idx >= 0) panelArr.splice(idx, 1);
		        });
		    } else {
		        // Single-panel
		        var arr = this.selectedCards[roundIdx];
		        var idx = arr.indexOf(card);
		        if (idx >= 0) arr.splice(idx, 1);
		    }
		    // Remove from all panels (The card should currently be on the Stage)
		    [this.projectPanels[roundIdx]].concat(dropPanels)
		        .forEach(function(panel){
		            if (panel && typeof panel.contains === "function" && panel.contains(card)) panel.removeChild(card);
		        });
		    // Parse color from card type
		    var cardInfo = parsePointsAndCost(card._cardType);
		    var color = cardInfo.color;
		    // Strict color enforcement
		    let foundPanel = null;
		    let foundPanelIdx = -1;
		    for (let i = 0; i < dropPanels.length; i++) {
		        let panel = dropPanels[i];
		        let panelColor = getPanelColor.call(this, panel);
		        // For multi-panel levels, color must match
		        if (panelHit(card, panel) && panelColor === color) {
		            foundPanel = panel;
		            foundPanelIdx = i;
		            break;
		        }
		    }
		    // For single-panel levels (like level 1), allow any card
		    if (!foundPanel && dropPanels.length === 1 && panelHit(card, dropPanels[0])) {
		        foundPanel = dropPanels[0];
		        foundPanelIdx = 0;
		    }
		    var toPanel, toArr;
		    var dropGlobal = {
		        x: card.x + cardWidth/2,
		        y: card.y + cardHeight/2
		    };
		    if (foundPanel) {
		        toPanel = foundPanel;
		        if (
		            Array.isArray(this.selectedCards[roundIdx]) &&
		            Array.isArray(this.selectedCards[roundIdx][foundPanelIdx])
		        ) {
		            toArr = this.selectedCards[roundIdx][foundPanelIdx];
		        } else {
		            toArr = this.selectedCards[roundIdx];
		        }
		        toArr.push(card);
		    } else {
		        toPanel = this.projectPanels[roundIdx];
		        toArr = this.cards;
		        this.cards.push(card);
		    }
		    // Reposition the card locally to the target panel
		    var local = toPanel.globalToLocal(dropGlobal.x, dropGlobal.y);
		    toPanel.addChild(card); // Re-adds card, placing it on top of toPanel's children
		    card.x = local.x - cardWidth/2;
		    card.y = local.y - cardHeight/2;
		    // Layout cards for all panels in this round
		    // Project Panel Layout (Uses projectPanelSettings)
		    this._isLayingOutProjectPanel = true;
		    layoutCards.call(this, this.projectPanels[roundIdx], this.cards, 300, this.projectScroll.value);
		    this._isLayingOutProjectPanel = false;
		    // Selected Panel Layout (Uses panelSettings)
		    for (let i = 0; i < dropPanels.length; i++) {
		        let arr = Array.isArray(this.selectedCards[roundIdx][i]) ? this.selectedCards[roundIdx][i] : this.selectedCards[roundIdx];
		        layoutCards.call(this, dropPanels[i], arr, 300, this.selectedScroll.value);
		        addScrollbarToPanel.call(this, dropPanels[i], arr, this.selectedScroll, visibleRows);
		    }
		    addScrollbarToPanel.call(this, this.projectPanels[roundIdx], this.cards, this.projectScroll, visibleRows);
		    this.updatePointsAndCosts();
		    // Set userCards as all selected cards in current round
		    this.userCards =
		        Array.isArray(this.selectedCards[roundIdx][0])
		            ? this.selectedCards[roundIdx].flat()
		            : this.selectedCards[roundIdx].slice();
		    stage.off("stagemousemove", dragHandler);
		    stage.off("stagemouseup", dropHandler);
		}
		function layoutCards(panel, cardsArr, tweenTime, scrollY) {
		    scrollY = scrollY || 0;
		    // SET FLAG: Indicate we are processing the Project Panel
		    this._isLayingOutProjectPanel = (panel === this.projectPanels[this.roundNum - 1]);
		    for (var i = 0; i < cardsArr.length; i++) {
		        var card = cardsArr[i];
				console.log("caller 2");
		        // **Z-INDEX/VISIBILITY FIX:** Ensure the card is re-parented and placed at the top of the panel's children list.
		        if (card.parent !== panel) {
		            // The card is on the stage (from drag/drop) or another panel.
		            if (card.parent) card.parent.removeChild(card); // Remove from old parent (Stage or other panel)
		            panel.addChild(card); // Add it, forcing it to the top of this panel's z-order.
		        } else {
		            // The card is already a child of this panel, but we move it to the front 
		            // to ensure it's not obscured by any panel graphics/masks.
		            panel.setChildIndex(card, panel.numChildren - 1); 
		        }
		        var pos = getGridPosition.call(this, i); 
		        createjs.Tween.removeTweens(card);
		        if (tweenTime)
		            createjs.Tween.get(card).to({x: pos.x, y: pos.y + scrollY}, tweenTime, createjs.Ease.quadOut);
		        else {
		            card.x = pos.x;
		            card.y = pos.y + scrollY;
		        }
		        card._panelIndex = i;
		    }
		    // UNSET FLAG
		    this._isLayingOutProjectPanel = false;
		}
		function addScrollbarToPanel(panel, cardsArray, scrollYState, visibleRowsOverride) {
		    var roundIdx = this.roundNum - 1;
		    // Determine which settings to use: Project or Selected
		    var isProjectPanel = (panel === this.projectPanels[roundIdx]);
		    var settings = isProjectPanel 
		        ? this.projectPanelSettings[roundIdx] 
		        : this.panelSettings[roundIdx];
		    var panelWidth = settings.panelWidth;
		    var maxColumns = settings.maxColumns;
		    var cardHeight = settings.cardHeight;
		    var bottomPadding = 15;
		    var panelPadding = 10;
		    // Layout calculations
		    var rows = visibleRowsOverride || Math.ceil(cardsArray.length / maxColumns);
		    var visibleHeight = panelPadding * 2 + visibleRows * (cardHeight + bottomPadding) - bottomPadding;
		    // SET FLAG: to ensure getCardContentHeight uses the correct settings
		    this._isLayingOutProjectPanel = isProjectPanel;
		    var cardContentHeight = getCardContentHeight.call(this, cardsArray); 
		    this._isLayingOutProjectPanel = false; // UNSET FLAG
		    var maxScroll = Math.max(0, cardContentHeight - visibleHeight);
		    // Remove old scrollbar
		    if (panel._vScrollbarTrack) panel.removeChild(panel._vScrollbarTrack);
		    if (panel._vScrollbar) panel.removeChild(panel._vScrollbar);
		    if (panel._scrollWheelFn) {
		        stage.canvas.removeEventListener("wheel", panel._scrollWheelFn);
		        panel._scrollWheelFn = null;
		    }
		    if (cardsArray.length <= maxColumns || cardContentHeight <= visibleHeight) {
		        scrollYState.value = 0;
		        // SET FLAG
		        this._isLayingOutProjectPanel = isProjectPanel;
		        for (var i = 0; i < cardsArray.length; i++) {
		            var card = cardsArray[i];
					console.log("caller 3");
		            var pos = getGridPosition.call(this, i); 
		            createjs.Tween.removeTweens(card);
		            card.x = pos.x;
		            card.y = pos.y;
		        }
		        this._isLayingOutProjectPanel = false; // UNSET FLAG
		        if (panel._scrollWheelFn) {
		            stage.canvas.removeEventListener("wheel", panel._scrollWheelFn);
		            panel._scrollWheelFn = null;
		        }
		        panel._scrollable = false;
		        return;
		    }
		    panel._scrollable = true;
		    var scrollbarWidth = 10;
		    var scrollbarMargin = 4;
		    var trackHeight = visibleHeight - 2 * scrollbarMargin;
		    // Use the determined panelWidth for scrollbar placement
		    var scrollbarX = panelWidth - scrollbarWidth - scrollbarMargin; 
		    var scrollbarY = scrollbarMargin;
		    var scrollThumbMinHeight = 40;
		    var scrollbarTrackColor = "#E7E6E6";
		    var scrollbarBarColor = "#C2C1C1";
		    var barHeight = Math.max(scrollThumbMinHeight, (visibleHeight / cardContentHeight) * trackHeight);
		    scrollYState.value = Math.max(Math.min(scrollYState.value, 0), -maxScroll);
		    // Track
		    var vScrollbarTrack = new createjs.Shape();
		    vScrollbarTrack.graphics.beginFill(scrollbarTrackColor)
		        .drawRoundRect(scrollbarX, scrollbarY, scrollbarWidth, trackHeight, scrollbarWidth/2);
		    panel.addChild(vScrollbarTrack);
		    // Thumb
		    var vScrollbar = new createjs.Shape();
		    vScrollbar.graphics.beginFill(scrollbarBarColor)
		        .drawRoundRect(scrollbarX, scrollbarY, scrollbarWidth, barHeight, scrollbarWidth/2);
		    vScrollbar.cursor = "pointer";
		    panel.addChild(vScrollbar);
		    var dragging = false, dragOffsetY = 0;
		    vScrollbar.on("mousedown", function(evt) {
		        if (scrollFocusPanel !== panel) return;
		        dragging = true;
		        dragOffsetY = evt.stageY - (vScrollbar.y + scrollbarY + panel.y);
		        stage.on("stagemousemove", dragMove.bind(this)); 
		        window.addEventListener("mouseup", dragUp);
		    }.bind(this)); 
		    function dragMove(ev) {
		        if (!dragging) return;
		        if (scrollFocusPanel !== panel) return;
		        var relY = ev.stageY - scrollbarY - panel.y - dragOffsetY;
		        var maxThumbY = trackHeight - barHeight;
		        relY = Math.max(0, Math.min(relY, maxThumbY));
		        var percent = relY / maxThumbY;
		        vScrollbar.y = relY;
		        var scrollY = -percent * maxScroll;
		        scrollYState.value = scrollY;
		        // SET FLAG
		        this._isLayingOutProjectPanel = isProjectPanel;
		        for (var i = 0; i < cardsArray.length; i++) {
		            var card = cardsArray[i];
					console.log("caller 4");
		            var pos = getGridPosition.call(this, i); 
		            card.x = pos.x;
		            card.y = pos.y + scrollY;
		        }
		        this._isLayingOutProjectPanel = false; // UNSET FLAG
		    }
		    dragMove = dragMove.bind(this); 
		    function dragUp() {
		        dragging = false;
		        stage.off("stagemousemove", dragMove);
		        window.removeEventListener("mouseup", dragUp);
		    }
		    panel.on("mouseover", function() { scrollFocusPanel = panel; });
		    panel.on("mouseout", function() { if (scrollFocusPanel === panel) scrollFocusPanel = null; });
		    panel._scrollWheelFn = function(e) {
		        if (scrollFocusPanel !== panel) return;
		        var oneRow = cardHeight + bottomPadding;
		        var scrollY = scrollYState.value - Math.sign(e.deltaY) * oneRow;
		        var minY = 0;
		        var maxY = -maxScroll;
		        if (scrollY > minY) scrollY = minY;
		        if (scrollY < maxY) scrollY = maxY;
		        scrollYState.value = scrollY;
		        // SET FLAG
		        this._isLayingOutProjectPanel = isProjectPanel;
		        for (var i = 0; i < cardsArray.length; i++) {
		            var card = cardsArray[i];
					console.log("caller 7");
		            var pos = getGridPosition.call(this, i); 
		            card.x = pos.x;
		            card.y = pos.y + scrollY;
		        }
		        this._isLayingOutProjectPanel = false; // UNSET FLAG
		        var percent = -scrollY / maxScroll;
		        var maxThumbY = trackHeight - barHeight;
		        vScrollbar.y = percent * maxThumbY;
		        e.preventDefault();
		    }.bind(this); 
		    stage.canvas.addEventListener("wheel", panel._scrollWheelFn, { passive: false });
		    // Initial position layout
		    // SET FLAG
		    this._isLayingOutProjectPanel = isProjectPanel;
		    for (var i = 0; i < cardsArray.length; i++) {
		        var card = cardsArray[i];
				console.log("caller 5");
		        var pos = getGridPosition.call(this, i); 
		        card.x = pos.x;
		        card.y = pos.y + (scrollYState.value || 0);
		    }
		    this._isLayingOutProjectPanel = false; // UNSET FLAG
		    vScrollbar.y = -scrollYState.value / maxScroll * (trackHeight - barHeight);
		    panel._vScrollbarTrack = vScrollbarTrack;
		    panel._vScrollbar = vScrollbar;
		}
		// === RESTART CARDS (MULTI-PANEL COMPATIBLE) ===
		this.restartCards = function() {
		    var roundIdx = this.roundNum - 1;
		    // Remove ALL cards from project panel and its array
		    this.panelAndCardsArr_refresh(this.projectPanels[roundIdx], this.cards);
		    // Remove ALL cards from selected panels and arrays
		    if (Array.isArray(this.selectedCards[roundIdx][0])) {
		        // Multi-panel
		        for (let i = 0; i < this.selectedPanels[roundIdx].length; i++) {
		            this.panelAndCardsArr_refresh(this.selectedPanels[roundIdx][i], this.selectedCards[roundIdx][i]);
		        }
		    } else {
		        // Single-panel
		        this.panelAndCardsArr_refresh(this.selectedPanels[roundIdx][0], this.selectedCards[roundIdx]);
		    }
		    // Setup cards for current project panel
		    this.startCardSetup(this.cardTypes, this.projectPanels[roundIdx], this.cards, this.projectScroll, true);
		    // Layout all panels
		    // Project Panel Layout
		    this._isLayingOutProjectPanel = true;
		    layoutCards.call(this, this.projectPanels[roundIdx], this.cards, 0);
		    this._isLayingOutProjectPanel = false;
		    // Selected Panels Layout
		    for (let i = 0; i < this.selectedPanels[roundIdx].length; i++) {
		        let arr = Array.isArray(this.selectedCards[roundIdx][i]) ? this.selectedCards[roundIdx][i] : this.selectedCards[roundIdx];
		        layoutCards.call(this, this.selectedPanels[roundIdx][i], arr, 0);
		    }
		    this.updatePointsAndCosts();
		    // Reset scroll offsets
		    this.projectScroll.value = 0;
		    this.selectedScroll.value = 0;
		    this.level1ResultsScroll = 0;
		}
		// === UPDATE POINTS AND COSTS (MULTI-PANEL COMPATIBLE) ===
		this.updatePointsAndCosts = function() {
		    var totalPoints = 0, totalCost = 0;
		    this.lastCurrentCards = [];
		    var roundIdx = this.roundNum - 1;
		    if (Array.isArray(this.selectedCards[roundIdx][0])) {
		        // Multi-panel
		        for (let i = 0; i < this.selectedCards[roundIdx].length; i++) {
		            for (let j = 0; j < this.selectedCards[roundIdx][i].length; j++) {
		                var cardObj = this.selectedCards[roundIdx][i][j];
		                var parsed = parsePointsAndCost(cardObj._cardType || "");
		                totalPoints += parsed.points;
		                totalCost += parsed.cost;
		                this.lastCurrentCards.push(cardObj._cardType);
		            }
		        }
		    } else {
		        // Single panel
		        for (var i = 0; i < this.selectedCards[roundIdx].length; i++) {
		            var cardObj = this.selectedCards[roundIdx][i];
		            var parsed = parsePointsAndCost(cardObj._cardType || "");
		            totalPoints += parsed.points;
		            totalCost += parsed.cost;
		            this.lastCurrentCards.push(cardObj._cardType);
		        }
		    }
		    this.lastCurrentPoints = String(totalPoints);
		    this.lastCurrentCost = String(totalCost);
		    if (this.obj_points && this.obj_points.txt_points) {
		        this.obj_points.txt_points.text = String(totalPoints);
		    }
		    if (this.obj_costs && this.obj_costs.txt_cost) {
		        this.obj_costs.txt_cost.text = totalCost + " / " + maxCost;
		        this.obj_costs.txt_cost.color = (totalCost > maxCost) ? "#da291c" : "#0C0808";
		    }
		}
		//------------------ TIMER
		this.formatTime = function(sec) {
		    var m = Math.floor(sec / 60);
		    var s = sec % 60;
		    return (m < 10 ? "0" : "") + m + ":" + (s < 10 ? "0" : "") + s;
		}
		// Update timer display
		this.updateTimerDisplay = function(ctx) {
		    ctx.obj_timer.text_timer.text = this.formatTime(ctx.timerCurrent);
		    ctx.obj_timer.text_timer.color = (ctx.timerCurrent <= 31) ? "#da291c" : "#0C0808";
		    //stage.update();
		}
		// Play (start/resume) timer
		this.playTimer = function() {
		    if (this.timerInterval) return;
		    var timeline = this;
		    this.timerInterval = setInterval(function() {
		        if (timeline.timerCurrent > 0) {
		            timeline.timerCurrent--;
		            timeline.updateTimerDisplay(timeline);
		            timeline.timerRanOut = false;
		        } else {
		            clearInterval(timeline.timerInterval);
		            timeline.timerInterval = null;
		            timeline.timerExpired();
		        }
		    }, 1000);
		    this.obj_timer.obj_clock.gotoAndPlay();
		};
		this.pauseTimer = function() {
		    if (this.timerInterval) {
		        clearInterval(this.timerInterval);
		        this.timerInterval = null;
		        this.obj_timer.obj_clock.gotoAndStop();
		    }
		};
		this.restartTimer = function() {
		    this.pauseTimer();
		    this.timerCurrent = this.timerDuration;
		    this.updateTimerDisplay(this);
		};
		this.timerExpired = function() {
		    this.timerRanOut = true;
		    this.obj_timer.obj_clock.gotoAndStop();
		    this.callPrompt("TimerRanOut");
		};

		//-----------RESULTS SETUP-------------

		    this.obj_results.obj_level1Results.obj_content.txt_time2.text = (this.timerDuration > this.timerCurrent) ? this.timerDuration - this.timerCurrent : this.timerDuration;
		    this.obj_results.obj_level1Results.obj_content.txt_points2.text = this.lastCurrentPoints;

		    } else if (this.lastCurrentPoints === 118) {

		};
		function addVerticalScrollbar(maskObj, contentObj, maskWidth, maskHeight, contentHeight, scrollState) {
		    // Remove previous scrollbar
		    if (maskObj._vScrollbarTrack) maskObj.removeChild(maskObj._vScrollbarTrack);
		    if (maskObj._vScrollbar) maskObj.removeChild(maskObj._vScrollbar);
		    if (contentHeight <= maskHeight) {
		        scrollState.value = 0;
		        contentObj.y = 0;
		        return;
		    }
		    var scrollbarWidth = 10;
		    var scrollbarMargin = 0; // No margin to avoid top/bottom gaps
		    var trackHeight = maskHeight - 2 * scrollbarMargin;
		    var scrollbarX = maskWidth - scrollbarWidth;
		    var scrollbarY = scrollbarMargin;
		    var scrollThumbMinHeight = 40;
		    var scrollbarTrackColor = window.scrollbarTrackColor || "#E7E6E6";
		    var scrollbarBarColor = window.scrollbarBarColor || "#C2C1C1";
		    var maxScroll = contentHeight - maskHeight;
		    var barHeight = Math.max(scrollThumbMinHeight, (maskHeight / contentHeight) * trackHeight);
		    var vScrollbarTrack = new createjs.Shape();
		    vScrollbarTrack.graphics.beginFill(scrollbarTrackColor)
		        .drawRoundRect(scrollbarX, scrollbarY, scrollbarWidth, trackHeight, scrollbarWidth / 2);
		    maskObj.addChild(vScrollbarTrack);
		    var vScrollbar = new createjs.Shape();
		    vScrollbar.graphics.beginFill(scrollbarBarColor)
		        .drawRoundRect(scrollbarX, scrollbarY, scrollbarWidth, barHeight, scrollbarWidth / 2);
		    vScrollbar.cursor = "pointer";
		    maskObj.addChild(vScrollbar);
		    var dragging = false, dragOffsetY = 0;
		    // Sync thumb/content
		    function updateThumbAndContent(scrollY) {
		        scrollY = Math.max(0, Math.min(scrollY, maxScroll));
		        scrollState.value = scrollY;
		        contentObj.y = -scrollY;
		        var percent = scrollY / maxScroll;
		        var maxThumbY = trackHeight - barHeight;
		        vScrollbar.y = scrollbarY + percent * maxThumbY;
		        maskObj.stage && maskObj.stage.update();
		    }
		    // Thumb drag
		    vScrollbar.on("mousedown", function(evt) {
		        dragging = true;
		        dragOffsetY = evt.stageY - (vScrollbar.y + maskObj.y);
		        maskObj.stage.on("stagemousemove", dragMove);
		        window.addEventListener("mouseup", dragUp);
		    });
		    function dragMove(ev) {
		        if (!dragging) return;
		        var relY = ev.stageY - maskObj.y - dragOffsetY;
		        var maxThumbY = trackHeight - barHeight;
		        relY = Math.max(scrollbarY, Math.min(relY, scrollbarY + maxThumbY));
		        var percent = (relY - scrollbarY) / maxThumbY;
		        var scrollY = percent * maxScroll;
		        updateThumbAndContent(scrollY);
		    }
		    function dragUp() {
		        dragging = false;
		        maskObj.stage.off("stagemousemove", dragMove);
		        window.removeEventListener("mouseup", dragUp);
		    }
		    // Wheel
		    maskObj._scrollWheelFn && maskObj.stage.canvas.removeEventListener("wheel", maskObj._scrollWheelFn);
		    maskObj._scrollWheelFn = function(e) {
		        var delta = Math.sign(e.deltaY) * 40;
		        var scrollY = scrollState.value + delta;
		        updateThumbAndContent(scrollY);
		        e.preventDefault();
		    };
		    maskObj.stage.canvas.addEventListener("wheel", maskObj._scrollWheelFn, { passive: false });
		    // Initial position
		    updateThumbAndContent(scrollState.value || 0);
		    maskObj._vScrollbarTrack = vScrollbarTrack;
		    maskObj._vScrollbar = vScrollbar;
		}
	}
